description:
This is the complete two issue miniseries of Nick Fury, Agent of S.H.I.E.L.D., which featured the plots &quot;Who Is Scorpio?&quot; and &quot;Whatever Happened To Scorpio?&quot;.

Thanks to Artnet-DCP for these great scans. Please seed, and enjoy. 

